          - StripPrefix=1\n\n    # sentinel 配置\n    sentinel:\n      # nacos配置持久化\n      datasource:\n        ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr}\n            dataId: sentinel-${spring.application.name}.json\n            groupId: ${spring.cloud.nacos.config.group}\n            namespace: ${spring.profiles.active}\n            data-type: json\n            rule-type: flow\n', '057fef317324841d22fc80e65fc7200c', '2022-11-07 18:30:20', '2022-11-07 10:30:21', 'nacos', '127.0.0.1', 'U', 'dev', '');
