INSERT INTO `his_config_info` VALUES (170, 1223, 'datasource.yml', 'DEFAULT_GROUP', '', 'datasource:\n  base-master:\n    # jdbc 所有参数配置参考 https://lionli.blog.csdn.net/article/details/122018562\n    # rewriteBatchedStatements=true 批处理优化 大幅提升批量插入更新删除性能\n    url: jdbc:mysql://localhost:3306/erahub-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8&rewriteBatchedStatements=true\n    username: root\n    password: erahub123\n  job:\n    url: jdbc:mysql://localhost:3306/erahub-job?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8&rewriteBatchedStatements=true\n    username: root\n    password: erahub123\n\nspring:\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 动态数据源文档 https://www.kancloud.cn/tracy5546/dynamic-datasource/content\n    dynamic:\n      # 性能分析插件(有性能损耗 不建议生产环境使用)\n      p6spy: true\n      # 开启seata代理，开启后默认每个数据源都代理，如果某个不需要代理可单独关闭\n      seata: true\n      # 严格模式 匹配不到数据源则报错\n      strict: true\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow:   false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n        filters: stat,wall,slf4j\n        # 启用内置过滤器（第一个 stat必须，否则监控不到SQL）\n        filter:\n          stat:\n            enabled: true\n            # 慢SQL记录\n            log-slow-sql: true\n            slow-sql-millis: 1000\n            merge-sql: true\n          wall:\n            config:\n              multi-statement-allow: true\n        # 配置 DruidStatFilter\n        web-stat-filter:\n          enabled: true\n          url-pattern: /*\n          exclusions: .js,*.gif,*.jpg,*.bmp,*.png,*.css,*.ico,/druid/*\n        # 配置监控访问\n        stat-view-servlet:\n          enabled: true\n          url-pattern: \'/druid/*\'\n          reset-enabled: false\n          login-username: erahub\n          login-password: erahub123\n# seata配置\nseata:\n  # 关闭自动代理\n  enable-auto-data-source-proxy: false\n', 'bcc25d0019342188e9fd9d4ea6f0bc90', '2022-11-07 19:06:41', '2022-11-07 11:06:42', 'nacos', '127.0.0.1', 'U', 'dev', '');
